// src/pages/Dashboard.jsx
import React from 'react';
import { Routes, Route } from 'react-router-dom';
import DashboardLayout from '../components/DashboardLayout';
import Profile from '../components/Profile';
import Tasks from '../components/Tasks';
import TrackProductivity from '../components/TrackProductivity';
import ProductivityInsights from '../components/ProductivityInsights';
import GoalsReminders from '../components/GoalsReminders';

const Dashboard = () => {
  return (
    <Routes>
      <Route path="/" element={<DashboardLayout />}>
        <Route path="profile" element={<Profile />} />
        <Route path="tasks" element={<Tasks />} />
        <Route path="track" element={<TrackProductivity />} />
        <Route path="insights" element={<ProductivityInsights />} />
        <Route path="goals" element={<GoalsReminders />} />
      </Route>
    </Routes>
  );
};

export default Dashboard;
